import React from "react";

const Login = () => {
  return (
    <div id="loginpage">
      <form id="loginform">
        <div className="userauth">
          <label className="email">Email</label>
          <input></input>
          <label className="password">Lozinka</label>
          <input></input>
        </div>
        <div id="loginbutton">
          <button>Prijava</button>
        </div>
      </form>
    </div>
  );
};

export default Login;
